        return 'Invalid input'
    total_eaten = number + need
    if total_eaten > remaining:
        return [total_eaten, 0]
    else:
        return [total_eaten, max(0, remaining - total_eaten)]

def do_algebra(operators, operands):
    result = operands[0]
    for i in range(1, len(operands)):
        if operators[i-1] == '+':
            result += operands[i]
        elif operators[i-1] == '-':
            result -= operands[i]
        elif operators[i-1] == '*':
            result *= operands[i]
        elif operators[i-1] == '//':
            result //= operands[i]
        elif operators[i-1] == '**':
            result **= operands[i]
    return result

import hashlib

def string_to_md5(text):
    if not text:
